// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.3;

import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721EnumerableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import './SaleClockAuction.sol';
import './SiringClockAuction.sol';
import './GeneScience.sol';
import './WODToken.sol';
import './RubyToken.sol';

contract DogeHero is ERC721EnumerableUpgradeable, AccessControlUpgradeable, PausableUpgradeable{
    string public uri;
    bytes32 public constant CEO_ROLE = keccak256("CEO_ROLE");
    bytes32 public constant COO_ROLE = keccak256("COO_ROLE");

    uint32[14] public cooldowns;
    uint256[14] public rubyFees;
    uint256[14] public wodFees;
    uint256 public secondsPerBlock;
    /// @notice The minimum payment required to use breedWithAuto(). This fee goes towards
    ///  the gas cost paid by whatever calls giveBirth(), and can be dynamically updated by
    ///  the COO role as the gas price changes.
    uint256 public autoBirthFee;

    // Keeps track of number of pregnant doges.
    uint256 public pregnantDoges;

    /// @dev The address of the sibling contract that is used to implement the sooper-sekret
    ///  genetic combination algorithm.
    GeneScience public geneScience;
    WODToken public wodToken;
    RubyToken public rubyToken;

    // Limits the number of doges the contract owner can ever create.
    uint256 public constant PROMO_CREATION_LIMIT = 5000;
    uint256 public constant GEN0_CREATION_LIMIT = 45000;

    // Constants for gen0 auctions.
    uint256 public constant GEN0_STARTING_PRICE = 0.01 ether;
    uint256 public constant GEN0_AUCTION_DURATION = 7 days;

    // Counts the number of doges the contract owner has created.
    uint256 public promoCreatedCount;
    uint256 public gen0CreatedCount;

    /*** DATA TYPES ***/

    /// @dev The main Doge struct. Every doge in CryptoDoges is represented by a copy
    ///  of this structure, so great care was taken to ensure that it fits neatly into
    ///  exactly two 256-bit words. Note that the order of the members in this structure
    ///  is important because of the byte-packing rules used by Ethereum.
    ///  Ref: http://solidity.readthedocs.io/en/develop/miscellaneous.html
    struct Doge {
        // The Doge's genetic code is packed into these 256-bits, the format is
        // sooper-sekret! A doge's genes never change.
        uint256 genes;

        // The timestamp from the block when this doge came into existence.
        uint64 birthTime;

        // The minimum timestamp after which this doge can engage in breeding
        // activities again. This same timestamp is used for the pregnancy
        // timer (for matrons) as well as the siring cooldown.
        uint64 cooldownEndBlock;

        // The ID of the parents of this Doge, set to 0 for gen0 doges.        
        uint64 matronId;
        uint64 sireId;

        // Set to the ID of the sire doge for matrons that are pregnant,
        // zero otherwise. A non-zero value here is how we know a doge
        // is pregnant. Used to retrieve the genetic material for the new
        // doge when the birth transpires.
        uint64 siringWithId;

        // Set to the index in the cooldown array (see below) that represents
        // the current cooldown duration for this Doge. This starts at zero
        // for gen0 doges, and is initialized to floor(generation/2) for others.
        // Incremented by one for each successful breeding action, regardless
        // of whether this doge is acting as matron or sire.
        uint32 cooldownIndex;

        // The "generation number" of this doge. Doges minted by the CK contract
        // for sale are called "gen0" and have a generation number of 0. The
        // generation number of all other doges is the larger of the two generation
        // numbers of their parents, plus one.
        // (i.e. max(matron.generation, sire.generation) + 1)
        uint32 generation;
    }  

    /// @dev An array containing the Doge struct for all Doges in existence. The ID
    ///  of each doge is actually an index into this array. Note that ID 0 is a negadoge,
    ///  the unDoge, the mythical beast that is the parent of all gen0 doges. A bizarre
    ///  creature that is both matron and sire... to itself! Has an invalid genetic code.
    ///  In other words, doge ID 0 is invalid... ;-)
    Doge[] doges;
    

    /// @dev A mapping from DogeIDs to an address that has been approved to use
    ///  this Doge for siring via breedWith(). Each Doge can only have one approved
    ///  address for siring at any time. A zero value means no approval is outstanding.
    mapping (uint256 => address) public sireAllowedToAddress;

    /// @dev The address of the ClockAuction contract that handles sales of Doges. This
    ///  same contract handles both peer-to-peer sales as well as the gen0 sales which are
    ///  initiated every 15 minutes.
    SaleClockAuction public saleAuction;

    /// @dev The address of a custom ClockAuction subclassed contract that handles siring
    ///  auctions. Needs to be separate from saleAuction because the actions taken on success
    ///  after a sales and siring auction are quite different.
    SiringClockAuction public siringAuction;
    
    /// @dev The Birth event is fired whenever a new doge comes into existence. This obviously
    ///  includes any time a doge is created through the giveBirth method, but it is also called
    ///  when a new gen0 doge is created.
    event Birth(address owner, uint256 dogeId, uint256 matronId, uint256 sireId, uint256 genes);
    
    /// @dev The Pregnant event is fired when two doges successfully breed and the pregnancy
    ///  timer begins for the matron.
    event Pregnant(address owner, uint256 matronId, uint256 sireId, uint256 cooldownEndBlock);


    function initialize() public initializer{
        __ERC721Enumerable_init();
        __ERC721_init("Doge Hero", "DOGEHERO");
        __AccessControl_init();
        __Pausable_init();
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(CEO_ROLE, msg.sender);
        _setupRole(COO_ROLE, msg.sender);

        // start with the mythical doge 0 - so we don't have generation-0 parent issues
        _createDoge(0, 0, 0, type(uint256).max, address(this));    

        uri = "worldofdoge.io/";       
        secondsPerBlock = 3;
        cooldowns = [
        uint32(15 minutes),
        uint32(30 minutes),
        uint32(1 hours),
        uint32(2 hours),
        uint32(4 hours),
        uint32(8 hours),
        uint32(16 hours),
        uint32(1 days),
        uint32(2 days),
        uint32(3 days),
        uint32(4 days),
        uint32(5 days),
        uint32(6 days),
        uint32(7 days)];
        autoBirthFee = 0.002 ether;
    }
    function supportsInterface(bytes4 interfaceId) public view virtual override(AccessControlUpgradeable, ERC721EnumerableUpgradeable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
    function setURI(string memory newURI) public onlyRole(DEFAULT_ADMIN_ROLE){
        uri = newURI;
    }
    function _baseURI() internal view override returns (string memory) {
        return uri;
    }
    function setRubyFees(uint[14] memory _rubyFees) external onlyRole(CEO_ROLE){
        rubyFees = _rubyFees;
    }
    function setWODFees(uint[14] memory _wodFees) external onlyRole(CEO_ROLE){
        wodFees = _wodFees;
    }
    function setCooldowns(uint32[14] memory _cooldowns) external onlyRole(CEO_ROLE){
        cooldowns = _cooldowns;
    }

    
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override{
        if (from != address(0)) {            
            // once the doge is transferred also clear sire allowances
            delete sireAllowedToAddress[tokenId];            
        }
        super._beforeTokenTransfer(from, to, tokenId);
    }
    /// @dev An internal method that creates a new doge and stores it. This
    ///  method doesn't do any checking and should only be called when the
    ///  input data is known to be valid. Will generate both a Birth event
    ///  and a Transfer event.
    /// @param _matronId The doge ID of the matron of this doge (zero for gen0)
    /// @param _sireId The doge ID of the sire of this doge (zero for gen0)
    /// @param _generation The generation number of this doge, must be computed by caller.
    /// @param _genes The doge's genetic code.
    /// @param _owner The inital owner of this doge, must be non-zero (except for the unDoge, ID 0)
    function _createDoge(
        uint256 _matronId,
        uint256 _sireId,
        uint256 _generation,
        uint256 _genes,
        address _owner
    )
        internal
        returns (uint)
    {
        // These requires are not strictly necessary, our calling code should make
        // sure that these conditions are never broken. However! _createDoge() is already
        // an expensive call (for storage), and it doesn't hurt to be especially careful
        // to ensure our data structures are always valid.
        require(_matronId == uint256(uint64(_matronId)));
        require(_sireId == uint256(uint64(_sireId)));
        require(_generation == uint256(uint32(_generation)));

        // New doge starts with the same cooldown as parent gen/2
        uint32 cooldownIndex = uint32(_generation / 2);
        if (cooldownIndex > 13) {
            cooldownIndex = 13;
        }

        Doge memory _doge = Doge({
            genes: _genes,
            birthTime: uint64(block.timestamp),
            cooldownEndBlock: 0,
            matronId: uint64(_matronId),
            sireId: uint64(_sireId),
            siringWithId: 0,
            cooldownIndex: cooldownIndex,
            generation: uint32(_generation)
        });

        uint256 newDogeId = doges.length;
        doges.push(_doge);
         

        // It's probably never going to happen, 4 billion doges is A LOT, but
        // let's just be 100% sure we never let this happen.
        require(newDogeId == uint256(uint64(newDogeId)));

        // emit the birth event
        emit Birth(
            _owner,
            newDogeId,
            uint256(_doge.matronId),
            uint256(_doge.sireId),
            _doge.genes
        );

        // This will assign ownership, and also emit the Transfer event as
        // per ERC721 draft
        _mint(_owner, newDogeId);
        return newDogeId;
    }

    function setSecondsPerBlock(uint256 secs) external onlyRole(DEFAULT_ADMIN_ROLE) {
        require(secs < cooldowns[0]);
        secondsPerBlock = secs;
    }

    /// @dev Update the address of the genetic contract, can only be called by the CEO.
    /// @param _address An address of a GeneScience contract instance to be used from this point forward.
    function setGeneScienceAddress(address _address) external onlyRole(CEO_ROLE) {
        GeneScience candidateContract = GeneScience(_address);

        // NOTE: verify that a contract is what we expect - https://github.com/Lunyr/crowdsale-contracts/blob/cfadd15986c30521d8ba7d5b6f57b4fefcc7ac38/contracts/LunyrToken.sol#L117
        require(candidateContract.isGeneScience());

        // Set the new contract address
        geneScience = candidateContract;
    }

    function setWODTokenAddress(address _wodToken) external onlyRole(CEO_ROLE){
        wodToken = WODToken(_wodToken);
    }

    function setRubyTokenAddress(address _rubyToken) external onlyRole(CEO_ROLE){
        rubyToken = RubyToken(_rubyToken);
    }
    /// @dev Checks that a given doge is able to breed. Requires that the
    ///  current cooldown is finished (for sires) and also checks that there is
    ///  no pending pregnancy.
    function _isReadyToBreed(Doge memory _doge) internal view returns (bool) {
        // In addition to checking the cooldownEndBlock, we also need to check to see if
        // the doge has a pending birth; there can be some period of time between the end
        // of the pregnacy timer and the birth event.
        return (_doge.siringWithId == 0) && (_doge.cooldownEndBlock <= uint64(block.number));
    }

    /// @dev Check if a sire has authorized breeding with this matron. True if both sire
    ///  and matron have the same owner, or if the sire has given siring permission to
    ///  the matron's owner (via approveSiring()).
    function _isSiringPermitted(uint256 _sireId, uint256 _matronId) internal view returns (bool) {
        // address matronOwner = dogeIndexToOwner[_matronId];
        // address sireOwner = dogeIndexToOwner[_sireId];
        address matronOwner = ownerOf(_matronId);
        address sireOwner = ownerOf(_sireId);
        // Siring is okay if they have same owner, or if the matron's owner was given
        // permission to breed with this sire.
        return (matronOwner == sireOwner || sireAllowedToAddress[_sireId] == matronOwner);
    }

    /// @dev Set the cooldownEndTime for the given Doge, based on its current cooldownIndex.
    ///  Also increments the cooldownIndex (unless it has hit the cap).
    /// @param _doge A reference to the Doge in storage which needs its timer started.
    function _triggerCooldown(Doge storage _doge) internal {
        // Compute an estimation of the cooldown time in blocks (based on current cooldownIndex).
        _doge.cooldownEndBlock = uint64((cooldowns[_doge.cooldownIndex]/secondsPerBlock) + block.number);

        // Increment the breeding count, clamping it at 13, which is the length of the
        // cooldowns array. We could check the array size dynamically, but hard-coding
        // this as a constant saves gas. Yay, Solidity!
        if (_doge.cooldownIndex < 13) {
            _doge.cooldownIndex += 1;
        }
    }

    /// @notice Grants approval to another user to sire with one of your Doges.
    /// @param _addr The address that will be able to sire with your Doge. Set to
    ///  address(0) to clear all siring approvals for this Doge.
    /// @param _sireId A Doge that you own that _addr will now be able to sire with.
    function approveSiring(address _addr, uint256 _sireId)
        external
        whenNotPaused
    {
        require(ownerOf(_sireId) == msg.sender);
        sireAllowedToAddress[_sireId] = _addr;
    }

    /// @dev Updates the minimum payment required for calling giveBirthAuto(). Can only
    ///  be called by the COO address. (This fee is used to offset the gas cost incurred
    ///  by the autobirth daemon).
    function setAutoBirthFee(uint256 val) external onlyRole(COO_ROLE) {
        autoBirthFee = val;
    }

    /// @dev Checks to see if a given Doge is pregnant and (if so) if the gestation
    ///  period has passed.
    function _isReadyToGiveBirth(Doge memory _matron) private view returns (bool) {
        return (_matron.siringWithId != 0) && (_matron.cooldownEndBlock <= uint64(block.number));
    }

    /// @notice Checks that a given doge is able to breed (i.e. it is not pregnant or
    ///  in the middle of a siring cooldown).
    /// @param _dogeId reference the id of the doge, any user can inquire about it
    function isReadyToBreed(uint256 _dogeId)
        public
        view
        returns (bool)
    {
        require(_dogeId > 0);
        Doge storage doge = doges[_dogeId];
        return _isReadyToBreed(doge);
    }

    /// @dev Checks whether a doge is currently pregnant.
    /// @param _dogeId reference the id of the doge, any user can inquire about it
    function isPregnant(uint256 _dogeId)
        public
        view
        returns (bool)
    {
        require(_dogeId > 0);
        // A doge is pregnant if and only if this field is set
        return doges[_dogeId].siringWithId != 0;
    }

    /// @dev Internal check to see if a given sire and matron are a valid mating pair. DOES NOT
    ///  check ownership permissions (that is up to the caller).
    /// @param _matron A reference to the Doge struct of the potential matron.
    /// @param _matronId The matron's ID.
    /// @param _sire A reference to the Doge struct of the potential sire.
    /// @param _sireId The sire's ID
    function _isValidMatingPair(
        Doge storage _matron,
        uint256 _matronId,
        Doge storage _sire,
        uint256 _sireId
    )
        private
        view
        returns(bool)
    {
        // A Doge can't breed with itself!
        if (_matronId == _sireId) {
            return false;
        }

        // Doges can't breed with their parents.
        if (_matron.matronId == _sireId || _matron.sireId == _sireId) {
            return false;
        }
        if (_sire.matronId == _matronId || _sire.sireId == _matronId) {
            return false;
        }

        // We can short circuit the sibling check (below) if either doge is
        // gen zero (has a matron ID of zero).
        if (_sire.matronId == 0 || _matron.matronId == 0) {
            return true;
        }

        // Doges can't breed with full or half siblings.
        if (_sire.matronId == _matron.matronId || _sire.matronId == _matron.sireId) {
            return false;
        }
        if (_sire.sireId == _matron.matronId || _sire.sireId == _matron.sireId) {
            return false;
        }

        // Everything seems cool! Let's get DTF.
        return true;
    }

    /// @dev Internal check to see if a given sire and matron are a valid mating pair for
    ///  breeding via auction (i.e. skips ownership and siring approval checks).
    function _canBreedWithViaAuction(uint256 _matronId, uint256 _sireId)
        internal
        view
        returns (bool)
    {
        Doge storage matron = doges[_matronId];
        Doge storage sire = doges[_sireId];
        return _isValidMatingPair(matron, _matronId, sire, _sireId);
    }

    /// @notice Checks to see if two doges can breed together, including checks for
    ///  ownership and siring approvals. Does NOT check that both doges are ready for
    ///  breeding (i.e. breedWith could still fail until the cooldowns are finished).
    ///  TODO: Shouldn't this check pregnancy and cooldowns?!?
    /// @param _matronId The ID of the proposed matron.
    /// @param _sireId The ID of the proposed sire.
    function canBreedWith(uint256 _matronId, uint256 _sireId)
        external
        view
        returns(bool)
    {
        require(_matronId > 0);
        require(_sireId > 0);
        Doge storage matron = doges[_matronId];
        Doge storage sire = doges[_sireId];
        return _isValidMatingPair(matron, _matronId, sire, _sireId) &&
            _isSiringPermitted(_sireId, _matronId);
    }

    /// @dev Internal utility function to initiate breeding, assumes that all breeding
    ///  requirements have been checked.
    function _breedWith(uint256 _matronId, uint256 _sireId, address _matronOwner) internal {
        // Grab a reference to the Doges from storage.
        Doge storage sire = doges[_sireId];
        Doge storage matron = doges[_matronId];

        // Mark the matron as pregnant, keeping track of who the sire is.
        matron.siringWithId = uint64(_sireId);

        //pay breeding fees
        _payBreedingFees(sire, matron, _matronOwner);

        // Trigger the cooldown for both parents.
        _triggerCooldown(sire);
        _triggerCooldown(matron);
        
        // Clear siring permission for both parents. This may not be strictly necessary
        // but it's likely to avoid confusion!
        delete sireAllowedToAddress[_matronId];
        delete sireAllowedToAddress[_sireId];

        // Every time a doge gets pregnant, counter is incremented.
        pregnantDoges++;

        // Emit the pregnancy event.
        emit Pregnant(ownerOf(_matronId), _matronId, _sireId, matron.cooldownEndBlock);
    }
    function _payBreedingFees(Doge storage sire, Doge storage matron, address sender) internal{       
        uint ruby = rubyFees[sire.cooldownIndex] + rubyFees[matron.cooldownIndex];
        uint wod = wodFees[sire.cooldownIndex] + wodFees[matron.cooldownIndex];
        rubyToken.burn(sender, ruby);
        wodToken.burn(sender, wod);
    }

    /// @notice Breed a Doge you own (as matron) with a sire that you own, or for which you
    ///  have previously been given Siring approval. Will either make your doge pregnant, or will
    ///  fail entirely. Requires a pre-payment of the fee given out to the first caller of giveBirth()
    /// @param _matronId The ID of the Doge acting as matron (will end up pregnant if successful)
    /// @param _sireId The ID of the Doge acting as sire (will begin its siring cooldown if successful)
    function breedWithAuto(uint256 _matronId, uint256 _sireId)
        external
        payable
        whenNotPaused
    {
        // Checks for payment.
        require(msg.value >= autoBirthFee);
        // Caller must own the matron.
        require(ownerOf(_matronId) == msg.sender);

        // Neither sire nor matron are allowed to be on auction during a normal
        // breeding operation, but we don't need to check that explicitly.
        // For matron: The caller of this function can't be the owner of the matron
        //   because the owner of a Doge on auction is the auction house, and the
        //   auction house will never call breedWith().
        // For sire: Similarly, a sire on auction will be owned by the auction house
        //   and the act of transferring ownership will have cleared any oustanding
        //   siring approval.
        // Thus we don't need to spend gas explicitly checking to see if either doge
        // is on auction.

        // Check that matron and sire are both owned by caller, or that the sire
        // has given siring permission to caller (i.e. matron's owner).
        // Will fail for _sireId = 0
        require(_isSiringPermitted(_sireId, _matronId));
        // Grab a reference to the potential matron
        Doge storage matron = doges[_matronId];

        // Make sure matron isn't pregnant, or in the middle of a siring cooldown
        require(_isReadyToBreed(matron));

        // Grab a reference to the potential sire
        Doge storage sire = doges[_sireId];

        // Make sure sire isn't pregnant, or in the middle of a siring cooldown
        require(_isReadyToBreed(sire));

        // Test that these doges are a valid mating pair.
        require(_isValidMatingPair(
            matron,
            _matronId,
            sire,
            _sireId
        ));
        
        // All checks passed, doge gets pregnant!
        _breedWith(_matronId, _sireId, msg.sender);
    }
    /// @notice Have a pregnant Doge give birth!
    /// @param _matronId A Doge ready to give birth.
    /// @return The Doge ID of the new doge.
    /// @dev Looks at a given Doge and, if pregnant and if the gestation period has passed,
    ///  combines the genes of the two parents to create a new doge. The new Doge is assigned
    ///  to the current owner of the matron. Upon successful completion, both the matron and the
    ///  new doge will be ready to breed again. Note that anyone can call this function (if they
    ///  are willing to pay the gas!), but the new doge always goes to the mother's owner.
    
    function giveBirth(uint256 _matronId)
        external
        whenNotPaused
        returns(uint256)
    {
        // Grab a reference to the matron in storage.
        Doge storage matron = doges[_matronId];

        // Check that the matron is a valid doge.
        require(matron.birthTime != 0);

        // Check that the matron is pregnant, and that its time has come!
        require(_isReadyToGiveBirth(matron));

        // Grab a reference to the sire in storage.
        uint256 sireId = matron.siringWithId;
        Doge storage sire = doges[sireId];

        // Determine the higher generation number of the two parents
        uint32 parentGen = matron.generation;
        uint32 sireGen = sire.generation;
        
        if (sireGen > parentGen) {
            parentGen = sireGen;
        }

        // Call the sooper-sekret gene mixing operation.
        uint256 childGenes = geneScience.mixGenes(matron.genes, sire.genes, matron.cooldownEndBlock - 1);
        // Make the new doge!
        address owner = ownerOf(_matronId);
        uint256 dogeId = _createDoge(_matronId, sireId, parentGen + 1, childGenes, owner);

        // Clear the reference to sire from the matron (REQUIRED! Having siringWithId
        // set is what marks a matron as being pregnant.)
        delete matron.siringWithId;

        // Every time a doge gives birth counter is decremented.
        pregnantDoges--;

        // Send the balance fee to the person who made birth happen.
        
        _sendEther(payable(msg.sender), autoBirthFee);

        // return the new doge's ID
        return dogeId;
    }

    // `saleAuction` refers to the auction for gen0 and p2p sale of doges.
    // `siringAuction` refers to the auction for siring rights of doges.

    /// @dev Sets the reference to the sale auction.
    /// @param _address - Address of sale contract.    
    function setSaleAuctionAddress(address _address) external onlyRole(CEO_ROLE) {
        SaleClockAuction candidateContract = SaleClockAuction(_address);

        // NOTE: verify that a contract is what we expect - https://github.com/Lunyr/crowdsale-contracts/blob/cfadd15986c30521d8ba7d5b6f57b4fefcc7ac38/contracts/LunyrToken.sol#L117
        require(candidateContract.isSaleClockAuction());

        // Set the new contract address
        saleAuction = candidateContract;

        if(!isApprovedForAll(address(this), _address)){
            _setApprovalForAll(address(this), _address, true);            
        }
    }

    /// @dev Sets the reference to the siring auction.
    /// @param _address - Address of siring contract.
    function setSiringAuctionAddress(address _address) external onlyRole(CEO_ROLE) {
        SiringClockAuction candidateContract = SiringClockAuction(_address);

        // NOTE: verify that a contract is what we expect - https://github.com/Lunyr/crowdsale-contracts/blob/cfadd15986c30521d8ba7d5b6f57b4fefcc7ac38/contracts/LunyrToken.sol#L117
        require(candidateContract.isSiringClockAuction());

        // Set the new contract address
        siringAuction = candidateContract;
    }

    /// @dev Put a doge up for auction.
    function createSaleAuction(
        uint256 _dogeId,
        uint256 _startingPrice,
        uint256 _endingPrice,
        uint256 _duration
    )
        external
        whenNotPaused
    {
        // Auction contract checks input sizes
        // If doge is already on any auction, this will throw
        // because it will be owned by the auction contract.
        require(ownerOf(_dogeId) == msg.sender);
        // Ensure the doge is not pregnant to prevent the auction
        // contract accidentally receiving ownership of the child.
        // NOTE: the doge IS allowed to be in a cooldown.
        require(!isPregnant(_dogeId));
        
        //client will manually use setApprovalForAll for approving Sale contract
        //to save gas cost for every sale Auction
        // approve(address(saleAuction), _dogeId);
        
        // Sale auction throws if inputs are invalid and clears
        // transfer and sire approval after escrowing the doge.
        saleAuction.createAuction(
            _dogeId,
            _startingPrice,
            _endingPrice,
            _duration,
            msg.sender
        );
    }

    /// @dev Put a doge up for auction to be sire.
    ///  Performs checks to ensure the doge can be sired, then
    ///  delegates to reverse auction.
    function createSiringAuction(
        uint256 _dogeId,
        uint256 _startingPrice,
        uint256 _endingPrice,
        uint256 _duration
    )
        external
        whenNotPaused
    {
        // Auction contract checks input sizes
        // If doge is already on any auction, this will throw
        // because it will be owned by the auction contract.
        require(ownerOf(_dogeId) == msg.sender);
        require(isReadyToBreed(_dogeId));
        //client will manually use setApprovalForAll for approving Sale contract
        //to save gas cost for every sale Auction
        // approve(address(siringAuction), _dogeId);
        // Siring auction throws if inputs are invalid and clears
        // transfer and sire approval after escrowing the doge.
        siringAuction.createAuction(
            _dogeId,
            _startingPrice,
            _endingPrice,
            _duration,
            msg.sender
        );
    }

    /// @dev Completes a siring auction by bidding.
    ///  Immediately breeds the winning matron with the sire on auction.
    /// @param _sireId - ID of the sire on auction.
    /// @param _matronId - ID of the matron owned by the bidder.
    function bidOnSiringAuction(
        uint256 _sireId,
        uint256 _matronId
    )
        external
        payable
        whenNotPaused
    {
        // Auction contract checks input sizes
        require(ownerOf(_matronId) == msg.sender);
        require(isReadyToBreed(_matronId));
        require(_canBreedWithViaAuction(_matronId, _sireId));
        uint birthFee = autoBirthFee;
        // Define the current price of the auction.
        uint256 currentPrice = siringAuction.getCurrentPrice(_sireId);
        require(msg.value >= currentPrice + birthFee);

        // Siring auction will throw if the bid fails.
        siringAuction.bid{value:msg.value - birthFee}(_sireId);
        _breedWith(uint64(_matronId), uint64(_sireId), msg.sender);
    }

    /// @dev Transfers the balance of the sale auction contract
    /// to the DogeHero contract. We use two-step withdrawal to
    /// prevent two transfer calls in the auction bid function.
    function withdrawAuctionBalances() external onlyRole(DEFAULT_ADMIN_ROLE) {
        saleAuction.withdrawBalance();
        siringAuction.withdrawBalance();
    }

   
    /// @dev we can create promo doges, up to a limit. Only callable by COO
    /// @param _genes the encoded genes of the doge to be created, any value is accepted
    /// @param _owner the future owner of the created doges. Default to contract COO
    function createPromoDoge(uint256 _genes, address _owner) external onlyRole(COO_ROLE) {        
        uint createdAmount = promoCreatedCount;
        require(createdAmount < PROMO_CREATION_LIMIT);
       
        promoCreatedCount = createdAmount + 1;
        _createDoge(0, 0, 0, _genes, _owner);
    }
    function createPromoDogeBatch(uint256[] memory _genes, address[] memory _owner) external onlyRole(COO_ROLE) {        
        uint createdAmount = promoCreatedCount;
        require(createdAmount + _genes.length < PROMO_CREATION_LIMIT);
        require(_genes.length == _owner.length);
        promoCreatedCount = createdAmount + _genes.length;
        for(uint i = 0; i < _genes.length; i++){
            _createDoge(0, 0, 0, _genes[i], _owner[i]);
        }
        
    }
    /// @dev Creates a new gen0 doge with the given genes and
    ///  creates an auction for it.
    function createGen0Auction(uint256 _genes) external onlyRole(COO_ROLE) {
        uint gen0 = gen0CreatedCount;
        require(gen0 < GEN0_CREATION_LIMIT);
        uint256 dogeId = _createDoge(0, 0, 0, _genes, address(saleAuction));
        //change this to setApprovalForAll to save gas
        // _approve(address(saleAuction), dogeId);
        
        saleAuction.createGen0Auction(
            dogeId,
            _computeNextGen0Price(),
            0,
            GEN0_AUCTION_DURATION,
            address(this)
        );
        
        gen0CreatedCount = gen0 + 1;
    }
    function createGen0AuctionBatch(uint256[] memory _genes) external onlyRole(COO_ROLE) {
        uint gen0 = gen0CreatedCount;
        require(_genes.length > 0);
        require(gen0 + _genes.length <= GEN0_CREATION_LIMIT);
        for(uint i = 0; i < _genes.length; i++){
            //create a doge for saleAuction
            uint256 dogeId = _createDoge(0, 0, 0, _genes[i], address(saleAuction));
            
            saleAuction.createGen0Auction(
                dogeId,
                _computeNextGen0Price(),
                0,
                GEN0_AUCTION_DURATION,
                address(this)
            );
        }        
        gen0CreatedCount = gen0 + _genes.length;
    }
    
    /// @dev Computes the next gen0 auction starting price, given
    ///  the average of the past 5 prices + 50%.
    function _computeNextGen0Price() internal view returns (uint256) {
        uint256 avePrice = saleAuction.averageGen0SalePrice();

        // Sanity check to ensure we don't overflow arithmetic
        require(avePrice == uint256(uint128(avePrice)));

        uint256 nextPrice = avePrice + (avePrice / 2);

        // We never auction for less than starting price
        if (nextPrice < GEN0_STARTING_PRICE) {
            nextPrice = GEN0_STARTING_PRICE;
        }

        return nextPrice;
    }

    function _sendEther(address payable _to, uint _amount) internal {        
        (bool sent,) = _to.call{value: _amount}("");
        require(sent, "Failed to send Ether");
    }

    receive() external payable {}
    fallback() external payable {}
    /// @notice Returns all the relevant information about a specific doge.
    /// @param _id The ID of the doge of interest.
    function getDoge(uint256 _id)
        external
        view
        returns (
        bool isGestating,
        bool isReady,
        uint256 cooldownIndex,
        uint256 nextActionAt,
        uint256 siringWithId,
        uint256 birthTime,
        uint256 matronId,
        uint256 sireId,
        uint256 generation,
        uint256 genes
    ) {
        Doge storage doge = doges[_id];

        // if this variable is 0 then it's not gestating
        isGestating = (doge.siringWithId != 0);
        isReady = (doge.cooldownEndBlock <= block.number);
        cooldownIndex = uint256(doge.cooldownIndex);
        nextActionAt = uint256(doge.cooldownEndBlock);
        siringWithId = uint256(doge.siringWithId);
        birthTime = uint256(doge.birthTime);
        matronId = uint256(doge.matronId);
        sireId = uint256(doge.sireId);
        generation = uint256(doge.generation);
        genes = doge.genes;
    }

    /// @dev Override unpause so it requires all external contract addresses
    ///  to be set before contract can be unpaused. Also, we can't have
    ///  newContractAddress set either, because then the contract was upgraded.
    /// @notice This is public rather than external so we can call super.unpause
    ///  without using an expensive CALL.
    function unpause() public onlyRole(CEO_ROLE) whenPaused {
        require(address(saleAuction) != address(0));
        require(address(siringAuction) != address(0));
        require(address(geneScience) != address(0));

        // Actually unpause the contract.
        _unpause();
    }
    function pause() external onlyRole(CEO_ROLE) whenNotPaused{
        _pause();
    }
    // @dev Allows the CFO to capture the balance available to the contract.
    function withdrawBalance() external onlyRole(CEO_ROLE) {
        uint256 balance = address(this).balance;
        // Subtract all the currently pregnant doges we have, plus 1 of margin.
        uint256 subtractFees = (pregnantDoges + 1) * autoBirthFee;
        if (balance > subtractFees) {            
            _sendEther(payable(msg.sender), balance - subtractFees);
        }
    }
}

